import LogoUpdate from "../components/LogoUpdate";

function LogoUpdatePage() {
  return (
    <>
      <div className="head-section">
        <h2>Update Logo</h2>
      </div>
      <div className="forms-content">
        <LogoUpdate />
      </div>
    </>
  );
}

export default LogoUpdatePage;
